import React from "react";

const nav = () => {
  return (
    <nav>
      <ul>
        <li>
          <a href="/">Home</a>
        </li>
        <li>
          <a href="/about">about</a>
        </li>
      </ul>
    </nav>
  );
};

export default nav;
